import styled from 'styled-components';

const ButtonStyles = styled.button`
  border: 1px solid var(--turquoise);
  border-radius: 5px;
  color: var(--turquoise);
  font-family: var(--titleFont);
  padding: 5px 10px;
  z-index: -10;
  transition: all 0.5s;


  a {
    display: inline-block;
    color: var(--turquoise);
  }

  &[disabled] {
    opacity: 0.5;
  }
`;

export default ButtonStyles;
